import React, { useState, useEffect } from 'react';
import TinderCard from 'react-tinder-card';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function MatchList({ userId }) {
  const [matches, setMatches] = useState([]);
  const [error, setError] = useState('');
  const [bottomMessage, setBottomMessage] = useState('');
  const navigate = useNavigate();

  const cuteAnimalEmojiMap = {
    "electrical engineering": "🐭",
    "mechanical engineering": "🐱",
    "civil engineering": "🐶",
    "chemical engineering": "🐹",
    "general engineering": "🐻",
    "computer science": "🦊"
  };

  const getEngineerEmoji = (user) => {
    if (user.major) {
      const normalizedMajor = user.major.trim().toLowerCase();
      return cuteAnimalEmojiMap[normalizedMajor] || "🐱";
    }
    return "🐱";
  };

  const fetchMatches = () => {
    axios.get(`/api/matches/find/${userId}`)
      .then(response => {
        if (Array.isArray(response.data)) {
          setMatches(response.data);
          setError('');
        } else {
          setMatches([]);
          setError(response.data);
        }
      })
      .catch(err => {
        setError(err.response?.data || 'Error fetching matches');
        setMatches([]);
      });
  };

  useEffect(() => {
    if (userId) fetchMatches();
  }, [userId]);

  const getUsername = (user) => {
    return user.name && user.name.trim() !== "" ? user.name : user.email.split('@')[0];
  };

  const onSwipe = (direction, matchUserId) => {
    if (direction === 'right') {
      axios.post(`/api/matches/swipe?user1Id=${userId}&user2Id=${matchUserId}`)
        .then(response => {
          setMatches(prev => prev.filter(match => match.user.id !== matchUserId));
          setBottomMessage(response.data?.message || '');
        })
        .catch(err => {
          setMatches(prev => prev.filter(match => match.user.id !== matchUserId));
          setBottomMessage(err.response?.data || 'Error processing swipe.');
        });
    } else {
      setMatches(prev => prev.filter(match => match.user.id !== matchUserId));
      setBottomMessage('');
    }
  };

  const styles = {
    page: {
      background: 'linear-gradient(135deg, #e0f7fa, #ffffff)',
      minHeight: '100vh',
      padding: '2rem 1rem',
      textAlign: 'center'
    },
    header: {
      color: '#2c6e6a',
      marginBottom: '1rem',
      fontSize: '2rem'
    },
    cardContainer: {
      position: 'relative',
      width: '320px',
      height: '500px',
      margin: '0 auto'
    },
    card: {
      position: 'absolute',
      backgroundColor: '#ffffff',
      width: '320px',
      height: '500px',
      boxShadow: '0 4px 10px rgba(0,0,0,0.2)',
      borderRadius: '16px',
      display: 'flex',
      flexDirection: 'column',
      overflow: 'hidden'
    },
    emoji: {
      fontSize: '6rem',
      marginTop: '1rem'
    },
    textContainer: {
      marginTop: 'auto',
      textAlign: 'left',
      backgroundColor: 'rgba(0,0,0,0.6)',
      padding: '1rem',
      color: '#ffffff'
    },
    username: {
      fontSize: '1.8rem',
      fontWeight: 'bold',
      marginBottom: '0.5rem',
      color: '#ffffff',
      WebkitTextStroke: '1px #5ccdc1'
    },
    buttonContainer: {
      textAlign: 'center',
      marginTop: '1rem'
    },
    button: {
      padding: '0.75rem 1.5rem',
      fontSize: '1rem',
      backgroundColor: '#5ccdc1',
      color: '#fff',
      border: 'none',
      borderRadius: '25px',  // Rounder buttons
      cursor: 'pointer',
      margin: '0.5rem'
    },
    bottomMessage: {
      color: 'blue',
      textAlign: 'center',
      marginTop: '1rem'
    }
  };

  return (
    <div style={styles.page}>
      <h2 style={styles.header}>Match List</h2>
      <button style={styles.button} onClick={() => navigate('/update')}>
        Update Preferences
      </button>

      {error && (
        <p style={styles.bottomMessage}>
          {typeof error === 'object' ? JSON.stringify(error) : error}
        </p>
      )}

      <div style={styles.cardContainer}>
        {matches.map((match, index) => (
          <TinderCard
            key={match.user.id}
            onSwipe={(dir) => onSwipe(dir, match.user.id)}
            preventSwipe={[]}
          >
            <div style={{ ...styles.card, zIndex: matches.length - index }}>
              <div style={styles.emoji}>{getEngineerEmoji(match.user)}</div>
              <div style={styles.textContainer}>
                <h3 style={styles.username}>{getUsername(match.user)}</h3>
                <p><strong>Common Days:</strong> {match.commonDays.join(', ')}</p>
                <p><strong>Common Subjects:</strong> {match.commonSubjects.join(', ')}</p>
                <div style={styles.buttonContainer}>
                  <button
                    style={{ ...styles.button, backgroundColor: '#f87171' }}
                    onClick={() => onSwipe('left', match.user.id)}
                  >
                    Swipe Left
                  </button>
                  <button
                    style={{ ...styles.button, backgroundColor: '#34d399' }}
                    onClick={() => onSwipe('right', match.user.id)}
                  >
                    Swipe Right
                  </button>
                </div>
              </div>
            </div>
          </TinderCard>
        ))}
        {matches.length === 0 && (
          <p style={{ color: '#777', marginTop: '2rem' }}>No matches available.</p>
        )}
      </div>

      {bottomMessage && <p style={styles.bottomMessage}>{bottomMessage}</p>}
    </div>
  );
}

export default MatchList;
